     ManageConnectionsEditAccounts = "important-web-feat-manage-connections-edit-accounts",
     CreateShareTemplates = "megaphone-web-feat-create-share-templates",
     Photos = "memento-web-feat-photos",
+    WebBackfillLoad = "stagility-web-feat-backfill-load",
 }

 export enum Experiments {
diff --git a/ynab_shared_library/app/web/adapters/WebStore.ts b/ynab_shared_library/app/web/adapters/WebStore.ts
index 5fec36788ef..3da4c5ebd71 100644
--- a/ynab_shared_library/app/web/adapters/WebStore.ts
+++ b/ynab_shared_library/app/web/adapters/WebStore.ts
@@ -20,6 +20,7 @@ import {
     IIncomingServerBudgetEntitiesCollection,
 } from "ynab_shared_library/app/base/interfaces/adapters/IServerEntitiesCollections";
 import {
+    BudgetSyncType,
     ISyncBudgetServerRequest,
     ISyncBudgetServerResponse,
 } from "ynab_shared_library/app/base/interfaces/adapters/ISyncBudgetData";
@@ -56,6 +57,7 @@ import { IEMChangedBudgetEntitiesCollection } from "ynab_shared_library/app/base
 import { FTUEStepManager } from "ynab_shared_library/app/base/managers/FTUEStepManager";
 import { FTUESteps } from "ynab_shared_library/app/base/enums/FTUEStep";
 import * as Metrics from "ynab_shared_library/app/base/metrics";
+import { AmpEx, FeatureFlags } from "ynab_shared_library/app/base/utilities/AmpEx";

 type IIncomingClientEntities =
     | IIncomingCatalogClientEntities
@@ -388,7 +390,24 @@ export class WebStore extends BaseStore {

                     // Load all the budget view models for the new budget
                     if (this._activeUserBudget) {
-                        await this.syncBudgetDataWithServer();
+                        if (AmpEx.isFlagOrExperimentActiveForUser(this.loggedInUserId, FeatureFlags.WebBackfillLoad)) {
+                            this.sharedLibWebInstance.syncManager.setBootstrapSyncInProgress();
+                            await this.syncBudgetDataWithServer(BudgetSyncType.Bootstrap);
+                            // Do a backfill sync right away but don't wait for it to finish
+                            this.sharedLibWebInstance.syncManager.setBackfillSyncInProgress();
+                            void this.syncBudgetDataWithServer(BudgetSyncType.Backfill).finally(() => {
+                                this.sharedLibWebInstance.syncManager.setInitialLoadComplete();
+                                if (this._budgetKnowledge.currentDeviceKnowledge > 0) {
+                                    // There are local changes to sync after backfill is done.
+                                    // Send those up right away.
+                                    void this.syncBudgetDataWithServer(BudgetSyncType.Delta);
+                                }
+                            });
+                        } else {
+                            await this.syncBudgetDataWithServer(BudgetSyncType.Delta);
+                            this.sharedLibWebInstance.syncManager.setInitialLoadComplete();
+                        }
+
                         this._activeBudget = entityManager.getBudgetById(budgetVersionId);
                         this.sharedLibWebInstance.formattingManager.initFormatters(this._activeBudget);
                         ConsoleLogging.info("WebStore::SetActiveBudget completed.");

